sys_variable_value.value:
(function execute(inputs, outputs) {
 var calendars = []; 
 var json = JSON.parse(inputs.responseBody);

  for (var i=0; i<json.value.length; i++) {

		var calendarName = json.value[i].name;  
    	var calendarId = json.value[i].id;
    	var calendar = {'name':calendarName, 'id':calendarId, 'label':calendarName};
    	calendars.push(calendar);
    	gs.info(calendars);



  }

 outputs.calendars = {data: calendars};
  outputs.json = json;

// ... code ...
})(inputs, outputs);

