sys_variable_value.value:
//https://stackoverflow.com/questions/8925820/javascript-object-push-function
//Object Push instead of calendarObject...

(function execute(inputs, outputs) {

var calendarsArray = [];

  for (var i=0; i<inputs.json.value.length; i++) {

    var calendarObject = {};
    calendarObject.id = inputs.json.value[i].id;
    calendarObject.name = inputs.json.value[i].name.toString;

    calendarsArray[i] = calendarObject;

gs.info('Array: ' + calendarsArray);



  }
  outputs.calendars = calendarsArray;

})(inputs, outputs);

